import React from 'react';
import { Outlet } from 'react-router';
import Header from './Header';
import Footer from './Footer';

export const RootLayout = () => {
  return (
    <div style={{ display: 'flex', flexDirection: 'column', minHeight: '100vh' }}>
      <Header />
      <div style={{ flex: 1 }}>
        <Outlet />
      </div>
      <Footer />
    </div>
  );
};
